import { Splide, SplideSlide } from "@splidejs/react-splide";
import "@splidejs/splide/dist/css/splide.min.css";
import { NavLink } from "react-router-dom";

const Bounties = (props) => {
  return (
    <div className="bountyCard-Group">
      <Splide
        options={{
          speed: "3000",
          autoplay: true,
          type: "loop",
          pauseOnHover: true,
          wheel: true,
          drag: true,
        }}
      >
        <SplideSlide>
          <div className="bountyCard">
            <img src='' alt=''></img>
          </div>
        </SplideSlide>

        <SplideSlide>
          <div className="bountyCard"></div>
        </SplideSlide>

        <SplideSlide>
          <div className="bountyCard"></div>
        </SplideSlide>
      </Splide>
      ;
    </div>
  );
};

export default Bounties;
